    false,nt"url": null,nt"notes": "This narrative report for Swan Lake National
    Wildlife Refuge outlines Refuge accomplishments from May through August 1963. The
    report begins by summarizing the weather conditions, habitat conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, mammals, rodents,  raptors,
    fish, and disease- is also covered. The Refuge development and maintenance section
    discusses physical developments, plantings, and collections and receipts. Resource
    management is outlined; topics include grazingl. The public relations section of
    the report describes recreational uses, Refuge visitors, Refuge participation, and
    violations. Items of interest, NR forms and photographs are attached.",nt"owner_org":
